import React from 'react';
import CP from '../imgs/CP.webp';
import TS from '../imgs/travis.jpg';

const Card = () => {
  let cardArray = [];

  const createCard = (src, text) => (
    <div className="card">
      <div className="card-image-container">
        <img className="card-image" src={src} alt="card-img" />
      </div>
      <div className="card-name-container">
        <p className="card-name">{text}</p>
      </div>
    </div>
  );

  const common = createCard(CP, 'Common Projects');
  const trav = createCard(TS, "Travis Scott's");

